script: |
  super -f text -I q6064.spq | sort > q6064.out

inputs:
  - name: q6064.spq
    data: |
      SELECT + col0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT ( col1 ) NOT BETWEEN - col1 + - col0 + + col0 / + - col1 / + 42 AND + ( col1 );
  - name: tab2

outputs:
  - name: q6064.out
    data: |
      46
      64
      75
